import React, { Fragment } from 'react';
import MaterialTable from 'material-table'
import TableIcons from '../../common/materialicon'
import Input from '../../common/input'
import Button from '../../common/button'
import Combobox from '../../common/combobox'
import HistoryReport from '../../../core/report'


export default class LockerHistoryReport extends React.Component {

    columns = [
        { 
            title: 'Tòa nhà', 
            field: 'bName'
        },
        { 
            title: 'Tầng', 
            field: 'lLv'
        },
        { 
            title: 'Tủ',
             field: 'lLabel' },
        { 
            title: 'Hành động', 
            field: 'act',
            render: rowData => {
                if (rowData.act === 'DROPOFF') {
                    return(
                        <span style={{color: 'green'}}>
                            trả tủ
                        </span>
                    )
                }
                else if (rowData.act === 'PICKUP_HOLD'){
                    return(
                        <span style={{color: 'gray'}}>
                            mở tủ
                        </span>
                    )
                }
                else {
                    return(
                        <span style={{color: 'gray'}}>
                            Mở từ web
                        </span>
                    )
                }

            }
        },
        { 
            title: 'Trạng thái cánh tủ', 
            field: 'dState',
            render: rowData => {
                if ( rowData.dState === 'OPEN') {
                    return(
                        <span style={{color: 'grên'}}>
                            cánh tủ mở
                        </span>
                    )
                }
                else 
                {
                    return(
                        <span style={{color: 'red'}}>
                            cánh tử đóng
                        </span>
                    )
                }
                
            }
        },
        { 
            title: 'Người sử dụng cuối cùng',
             field: 'eName' 
        },
        { 
            title: 'ID nhân sự',
             field: 'eCode' 
        },
        { 
            title: 'Thời điểm thao tác cuối cùng',
             field: 'aTime' 
        },
       
    ]

    options1 = {
        search: false,
        showTitle: false,
        pageSize: 20,
        pageSizeOptions: [20],
    } 

    constructor(props) {
        super(props);
        this.state = {

        };
    }

    getDataFromServer = (query) => {
        return new Promise((resolve, reject) => {
            HistoryReport.getHistoryReport(0,0,'','','','','','', query.page+ 1)
            .then(value => {
                resolve({
                    data: value.items,
                    page: value.currentPage - 1,
                    totalCount: value.total,
                })            
            })
        })
    }

    componentDidMount() {
    }

    render() {
        return(
            <Fragment>
                LockerHistoryReport
                <MaterialTable
                 options={this.options1}
                 icons={TableIcons}
                 columns={this.columns}
                 data={this.getDataFromServer}
                 title="LockerHistoryReport"
                />
                
            </Fragment>
        )
    }
}
